@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Authorization a owl:Class .
atm:SuccessfulAuthorization a owl:Class .

atm:SuccessfulAuthorization rdfs:subClassOf atm:Authorization .

atm:isSuccessful a owl:ObjectProperty ;
    rdfs:domain atm:Authorization ;
    rdfs:range atm:SuccessfulAuthorization .
